type PerModelRefinementOptions = {
  getTotalLimit: () => number
  limitLabel: string
  itemLabel: string
}

const applyPerModelLimitRefinement = <Schema extends z.ZodTypeAny>(
  schema: Schema,
  { getTotalLimit, limitLabel, itemLabel }: PerModelRefinementOptions
) =>
  schema.superRefine((params, ctx) => {
    const { questions, models } = params as {
      questions?: unknown
      models?: unknown
